                                                                    setValues={setMinPay}
                                                                    selectData={consts.payList.map((v) => { return { values: v, labels: numFormat(v) + "만원" } })}
                                                                />
                                                                <Selector
                                                                    subselectClass="selBox"
                                                                    placeholder="최대 금액"
                                                                    values={maxPay}
                                                                    setValues={setMaxPay}
                                                                    selectData={consts.payList.map((v) => { return { values: v, labels: numFormat(v) + "만원" } })}
                                                                />
                                                            </div>
                                                        </div>

                                                        <div className="tabBodyRow">
                                                            <div className="tbrTitle font-size">상하차 방법</div>
                                                            <div className="tbrInfo">
                                                                <Checkbox
