                                                                        return { names: v, values: v }
                                                                    })}
                                                                    fontweights={400}
                                                                    fontSizes={16}
                                                                    sizes={24}
                                                                />
                                                            </div>
                                                        </div>

                                                        <div className="tabBodyRow">
                                                            <div className="tbrTitle font-size">넘버승계</div>
                                                            <div className="tbrInfo">
                                                                <Checkbox
