                        <div className="pSlideBox">
                            <Swiper
                                listsImag={homeInfo?.partner_banner?.map((v, i) => {
                                    return consts.s3url + v.pc_path
                                })}
                                isButton
                                imgStyles={{
                                    height: "auto",
                                    aspectRatio: 6,
                                    objectFit: "cover",
                                    cursor: "pointer",
                                }}
                                onItemClick={(index) => {
                                    let mb_url = homeInfo?.partner_banner[index]?.url
                                    if (mb_url) {
                                        if (mb_url.indexOf("http") >= 0) {
                                            window.open(mb_url, "__blank")
                                        } else {
                                            navigate(mb_url)
                                        }
                                    }

