                            <div className="reportBtn" onClick={() => { window.open("https://www.nlic.go.kr/nlic/koilaReportProcess1.action", "_blank") }}>
                                <img src="/images/icons/alarm-warning-white.svg" alt="" />
                                <div className='fontsize20 bolds colorFFF'>신고하기</div>
                            </div>
                        </div>
                    </div>
